INSERT INTO `blogs` (`id`, `user_id`, `title`, `slug`, `description`, `status`, `image`, `thumbnail`, `viewed`, `authored_date`, `created_at`, `updated_at`, `lms_id`, `tags`, `category_id`, `authored_time`, `audience`, `authored_date_time`, `position_audience`) VALUES
(1, 1, '{\"en\":\"Learn Laravel (Best Laravel Tutorials for Beginners)\"}', 'yzZ6fM', '{\"en\":\"Laravel is a powerful open-source PHP framework designed to create the full-featured web application in a simple and elegant way. It is robust and easy to learn framework which follows MVC design pattern, the de facto standard of setting up web applications. You just need to be familiar with PHP basics to learn Laravel effectively. Laravel is a secure framework and prevents your website from several web attacks.\\r\\nLaravel was initially released in June 2011 to provide a more advanced alternative to the CodeIgniter framework. Laravel has clean routing, Object Relational Mapping (ORM), decent queue library, and ease of authentication etc.\"}', 1, 'public/demo/blog/image/1.png', 'public/demo/blog/thumb/1.png', 105, 'September 18, 2024', '2024-09-18 00:43:35', '2024-09-18 00:43:35', 1, NULL, 1, NULL, 1, '2024-09-18 00:00:00', 1),
(2, 1, '{\"en\":\"Laravel 5.8 From Scratch: Intro, Setup , MVC Basics, and Views.\"}', 'M6Z9v4', '{\"en\":\"Laravel is the most popular PHP framework built by Taylor Otwell and community. It uses MVC architecture pattern. It provides a lot of features like a complete Authentication System, Database Migrations , A Powerful ORM, Pagination, and so on. Before creating the application, you will need to have PHP 7.2 and MySQL (we are not using apache in this series) and composer installed. I use xampp which is a package that comes with PHP, MySQL, and Apache. Composer is a dependency manager for PHP. It’s similar to npm which is a dependency manager for Javascript. Also, read the server requirements for laravel if you run into installation errors\"}', 1, 'public/demo/blog/image/2.png', 'public/demo/blog/thumb/2.png', 105, 'September 18, 2024', '2024-09-18 00:43:35', '2024-09-18 00:43:35', 1, NULL, 2, NULL, 1, '2024-09-18 00:00:00', 1),
(3, 1, '{\"en\":\"Learning Python: From Zero to Hero\"}', 'D9LEvf', '{\"en\":\"For me, the first reason to learn Python was that it is, in fact, a beautiful programming language. It was really natural to code in it and express my thoughts.\\r\\nAnother reason was that we can use coding in Python in multiple ways: data science, web development, and machine learning all shine here. Quora, Pinterest and Spotify all use Python for their backend web development. So let’s learn a bit about it.\"}', 1, 'public/demo/blog/image/3.png', 'public/demo/blog/thumb/3.png', 105, 'September 18, 2024', '2024-09-18 00:43:35', '2024-09-18 00:43:35', 1, NULL, 3, NULL, 1, '2024-09-18 00:00:00', 1),
(4, 1, '{\"en\":\"Everything About Python — Beginner To Advanced\"}', 'qA49Ow', '{\"en\":\"This article aims to outline all of the key points of the Python programming language. My target is to keep the information short, relevant, and focus on the most important topics which are absolutely required to be understood.\\r\\nAfter reading this blog, you will be able to use any Python library or implement your own Python packages.\\r\\nYou are not expected to have any prior programming knowledge and it will be very quick to grasp all…\"}', 1, 'public/demo/blog/image/4.png', 'public/demo/blog/thumb/4.png', 106, 'September 18, 2024', '2024-09-18 00:43:35', '2024-09-22 16:07:12', 1, NULL, 3, NULL, 1, '2024-09-18 00:00:00', 1),
(5, 1, '{\"en\":\"Introduction to PHP for web developers 2018\"}', 'h7i4oU', '{\"en\":\"The more things are tangled up and depend on each other, the harder they are to work with. If you want to change your HTML, it’s a bit hard without your SQL stuff getting in the way. If you’re trying to fix something in the way the data is structured, you’ve got HTML in up in your grill. Bear in mind this is a simple example. An actual app would be much more complex and that gets exponentially more tangly.\"}', 1, 'public/demo/blog/image/5.png', 'public/demo/blog/thumb/5.png', 105, 'September 18, 2024', '2024-09-18 00:43:35', '2024-09-18 00:43:35', 1, NULL, 1, NULL, 1, '2024-09-18 00:00:00', 1);
