INSERT INTO `cookie_settings` (`id`, `title`, `details`, `btn_text`, `text_color`, `bg_color`, `allow`, `created_at`, `updated_at`, `lms_id`, `image`, `customize_btn_text`, `gdpr_details`, `gdpr_strictly`, `gdpr_performance`, `gdpr_functional`, `gdpr_targeting`, `gdpr_confirm_choice_btn_text`, `gdpr_accept_all_btn_text`) VALUES
(1, 'Cookies', 'We collect and use cookies to give you the best and most relevant website experience. Kindly accept the cookies.\n        <a href=\'\' >Privacy Policy</a>', 'I Accept', '#F8D4BE', '#FFEDE2', 1, '2024-09-18 00:43:15', '2024-09-18 00:43:26', 1, 'public/frontend/infixlmstheme/img/icon/cookies_icon.svg', 'Customize Setting', 'When you visit any of our websites, it may store or retrieve information on your browser, mostly in the form of cookies. This information might be about you, your preferences or your device and is mostly used to make the site work as you expect it to. The information does not usually directly identify you, but it can give you a more personalized web experience. Because we respect your right to privacy, you can choose not to allow some types of cookies. Click on the different category headings to find out more and manage your preferences. Please note, that blocking some types of cookies may impact your experience of the site and the services we are able to offer', 'These cookies are necessary for our website to function properly and cannot be switched off in our systems. They are usually only set in response to actions made by you that amount to a request for services, such as setting your privacy preferences, logging in or filling in forms, or where they’re essential to providing you with a service you have requested. You cannot opt out of these cookies. You can set your browser to block or alert you about these cookies, but if you do, some parts of the site will not then work. These cookies do not store any personally identifiable information', 'These cookies allow us to count visits and traffic sources so we can measure and improve the performance of our site. They help us to know which pages are the most and least popular and see how visitors move around the site, which helps us optimize your experience. All information these cookies collect is aggregated and therefore anonymous. If you do not allow these cookies we will not be able to use your data in this way.', 'These cookies enable the website to provide enhanced functionality and personalization. They may be set by us or by third-party providers whose services we have added to our pages. If you do not allow these cookies then some or all of these services may not function properly.', 'These cookies may be set through our site by our advertising partners. They may be used by those companies to build a profile of your interests and show you relevant adverts on other sites. They do not store directly personal information but are based on uniquely identifying your browser and internet device. If you do not allow these cookies, you will experience less targeted advertising.', 'Confirm My Choices', 'Accept All');
