INSERT INTO `footer_widgets` (`id`, `user_id`, `name`, `slug`, `description`, `category`, `page`, `page_id`, `section`, `is_static`, `status`, `created_at`, `updated_at`, `lms_id`, `custom`, `custom_link`) VALUES
(1, 1, '{\"en\":\"Unlock Your Potential\"}', 'unlock-your-potential', 'Do you ever feel like you have the potential to do great things with your life, but just aren’t sure how to start? We know that feeling very well, as it’s taken me years of reflection to figure out what activities makes you feel happy and fulfilled. We hope we will give you a gentle shove in the right direction', '1', '', 22, '1', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(2, 1, '{\"en\":\"Privacy policy and cookie policy\"}', 'privacy-policy-and-cookie-policy', 'A Privacy Policy is a legal document that explains the different ways you collect and manage a user\'s personal data. It is one of the most important legal documents for your website.A Cookies Policy is a policy explaining detailed and specific information about the cookies your website uses. The policy should explain the use of cookies and how a user can limit or prevent the placement of cookies on a device.Your website might need a separate Cookies Policy and Privacy Policy depending on your target audience and the privacy laws affecting your business.', '1', '', 23, '1', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(3, 1, '{\"en\":\"Sitemap\"}', 'sitemap', 'Sitemap, or XML sitemap, is a list of different pages on a website. XML is short for “extensible markup language,” which is a way to display information on a site. I\'ve consulted with so many website owners who are intimidated by this concept because sitemaps are considered a technical component of SEO', '1', '', 24, '1', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(4, 1, '{\"en\":\"Featured courses\"}', 'featured-courses', 'Sitemap, or XML sitemap, is a list of different pages on a website. XML is short for “extensible markup language,” which is a way to display information on a site. I\'ve consulted with so many website owners who are intimidated by this concept because sitemaps are considered a technical component of SEO', '1', '', 25, '1', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(5, 1, '{\"en\":\"Join Us\"}', 'join-us', 'Our goal is to learn the next generation of creative professionals for a future in any industry. We offer course in most demanded industries. Whether begin to your journey on our courses website or choose the flexibility of video learning our courses are designed to help you along your path.', '1', '', 26, '1', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(6, 1, '{\"en\":\"InfixEdu for Business\"}', 'infixedu-for-business', '\'Think about your specific user experience, and the journey the user will go through as they navigate your site,\' added Gabriel Shaoolian, CEO of website design and digital marketing agency Blue Fountain Media. \'Whatever the fundamental goal of your website is or whatever the focus may be, users should be easily able to achieve it, and the goal itself should be reinforced as users navigate throughout your site.\'If you don\'t plan to accept payments through your website, you won\'t have as much work to do in setting it up. If you are a retailer or service provider and want to offer customers the option to pay online, you\'ll need to use an external service to receive your payments, which we\'ll discuss later in this article. ', '2', '', 27, '2', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(7, 1, '{\"en\":\"Teach on InfixEdu\"}', 'teach-on-infixedu', 'From lesson plans and reproducibles to mini-books and differentiated collections, Scholastic Teachables has everything you need to go with your lessons in every subject. It’s the best of Scholastic classroom resources right at your fingertips.Best for Finding and Leveling Books: Book Wizard Use Scholastic’s Book Wizard to level your classroom library, discover resources for the books you teach, and find books at just the right level for students with Guided Reading, Lexile® Measure, and DRA levels for children\'s books. Best for Craft Projects: Crayola For Educators FInd hundreds of standards-based lesson plans, crafts, and activities for every grade level, plus art techniques for beginners to practiced artists. Here you will find what you need to supplement learning in every subject.', '2', '', 28, '2', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(8, 1, '{\"en\":\"Get the app\"}', 'get-the-app', 'Our goal is to learn the next generation of creative professionals for a future in any industry. We offer course in most demanded industries. Whether begin to your journey on our courses website or choose the flexibility of video learning our courses are designed to help you along your path', '2', '', 29, '2', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(9, 1, '{\"en\":\"About us\"}', '/about-us', 'Our goal is to learn the next generation of creative professionals for a future in any industry. We offer course in most demanded industries. Whether begin to your journey on our courses website or choose the flexibility of video learning our courses are designed to help you along your path', '2', 'about', 8, '2', 1, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(10, 1, '{\"en\":\"Contact us\"}', '/contact-us', 'Our goal is to learn the next generation of creative professionals for a future in any industry. We offer course in most demanded industries. Whether begin to your journey on our courses website or choose the flexibility of video learning our courses are designed to help you along your path', '2', 'contact', 7, '2', 1, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(11, 1, '{\"en\":\"Careers\"}', 'careers', 'Go Beyond Traditional Careers and Build Your Dreams with Us\n\nAt LMS, we believe in working hard, failing fast and learning every second. We are constantly exploring ways of making our customers life simple and empowered.\n\nWe are a family of youthful and diverse risk-takers and challengers who are solving global problems through transformation and disruption.\n\nWe are what our teacher and students are- the number one in the industry; and the greatest way we reward them is through the opportunity to Go Beyond in developing a nation through education', '3', 'contact', 32, '3', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(12, 1, '{\"en\":\"Blog\"}', '/blogs', 'Plus, you\'ll also learn Justin\'s go-to camera settings, must-have gear, and recommendations on a budget. By the end, you\'ll know how to master your settings, shoot in manual mode for total control. Transfers of Personal Data: The Services are hosted and operated in the United States (“U.S.”) through Skillshare and its service providers, and if you do not reside in the U.S., laws in the U.S. may differ from the laws where you reside. By using the Services, you acknowledge that any Personal Data about you.', '3', 'blogs', 10, '3', 1, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(13, 1, '{\"en\":\"Help and Support\"}', 'help-and-support', 'Plus, you\'ll also learn Justin\'s go-to camera settings, must-have gear, and recommendations on a budget. By the end, you\'ll know how to master your settings, shoot in manual mode for total control. Transfers of Personal Data: The Services are hosted and operated in the United States (“U.S.”) through Skillshare and its service providers, and if you do not reside in the U.S., laws in the U.S. may differ from the laws where you reside. By using the Services, you acknowledge that any Personal Data about you.', '3', '', 30, '3', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(14, 1, '{\"en\":\"Terms\"}', 'terms', 'A terminologist intends to hone categorical organization by improving the accuracy and content of its terminology. Technical industries and standardization institutes compile their own glossaries. This provides the consistency needed in the various areas—fields and branches, movements and specialties—to work with core terminology to then offer material for the discipline\'s traditional and doctrinal literature.\n\nTerminology is also then key in boundary-crossing problems, such as in language translation and social epistemology. Terminology helps to build bridges and to extend one area into another. Translators research the terminology of the languages they translate. Terminology is taught alongside translation in universities and translation schools. Large translation departments and translation bureaus have a Terminology section', '3', '', 31, '3', 0, 1, NULL, '2024-09-18 00:43:15', 1, 0, NULL),
(15, 1, '{\"en\":\"Certificate Verification\"}', 'certificate-verification', '', '3', NULL, 33, '3', 1, 1, '2024-09-18 00:43:18', '2024-09-18 00:43:18', 1, 0, NULL),
