(23, 'Privacy policy and cookie policy', 'Privacy policy and cookie policy', 'Privacy policy and cookie policy', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Privacy policy and cookie policy<\\/span>\\n                                <h3>Privacy policy and cookie policy<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            A Privacy Policy is a legal document that explains the different ways you collect and manage a user\'s personal data. It is one of the most important legal documents for your website.A Cookies Policy is a policy explaining detailed and specific information about the cookies your website uses. The policy should explain the use of cookies and how a user can limit or prevent the placement of cookies on a device.Your website might need a separate Cookies Policy and Privacy Policy depending on your target audience and the privacy laws affecting your business.\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'privacy-policy-and-cookie-policy', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
(24, 'Sitemap', 'Sitemap', 'Sitemap', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Sitemap<\\/span>\\n                                <h3>Sitemap<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            Sitemap, or XML sitemap, is a list of different pages on a website. XML is short for “extensible markup language,” which is a way to display information on a site. I\'ve consulted with so many website owners who are intimidated by this concept because sitemaps are considered a technical component of SEO\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'sitemap', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
