(26, 'Join Us', 'Join Us', 'Join Us', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Join Us<\\/span>\\n                                <h3>Join Us<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            Our goal is to learn the next generation of creative professionals for a future in any industry. We offer course in most demanded industries. Whether begin to your journey on our courses website or choose the flexibility of video learning our courses are designed to help you along your path.\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'join-us', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
(27, 'InfixEdu for Business', 'InfixEdu for Business', 'InfixEdu for Business', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>InfixEdu for Business<\\/span>\\n                                <h3>InfixEdu for Business<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            \'Think about your specific user experience, and the journey the user will go through as they navigate your site,\' added Gabriel Shaoolian, CEO of website design and digital marketing agency Blue Fountain Media. \'Whatever the fundamental goal of your website is or whatever the focus may be, users should be easily able to achieve it, and the goal itself should be reinforced as users navigate throughout your site.\'If you don\'t plan to accept payments through your website, you won\'t have as much work to do in setting it up. If you are a retailer or service provider and want to offer customers the option to pay online, you\'ll need to use an external service to receive your payments, which we\'ll discuss later in this article. \\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'infixedu-for-business', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
(28, 'Teach on InfixEdu', 'Teach on InfixEdu', 'Teach on InfixEdu', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Teach on InfixEdu<\\/span>\\n                                <h3>Teach on InfixEdu<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            From lesson plans and reproducibles to mini-books and differentiated collections, Scholastic Teachables has everything you need to go with your lessons in every subject. It’s the best of Scholastic classroom resources right at your fingertips.Best for Finding and Leveling Books: Book Wizard Use Scholastic’s Book Wizard to level your classroom library, discover resources for the books you teach, and find books at just the right level for students with Guided Reading, Lexile® Measure, and DRA levels for children\'s books. Best for Craft Projects: Crayola For Educators FInd hundreds of standards-based lesson plans, crafts, and activities for every grade level, plus art techniques for beginners to practiced artists. Here you will find what you need to supplement learning in every subject.\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'teach-on-infixedu', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
