(31, 'Terms', 'Terms', 'Terms', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Terms<\\/span>\\n                                <h3>Terms<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            A terminologist intends to hone categorical organization by improving the accuracy and content of its terminology. Technical industries and standardization institutes compile their own glossaries. This provides the consistency needed in the various areas—fields and branches, movements and specialties—to work with core terminology to then offer material for the discipline\'s traditional and doctrinal literature.\\n\\nTerminology is also then key in boundary-crossing problems, such as in language translation and social epistemology. Terminology helps to build bridges and to extend one area into another. Translators research the terminology of the languages they translate. Terminology is taught alongside translation in universities and translation schools. Large translation departments and translation bureaus have a Terminology section\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'terms', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
(32, 'careers', 'Careers', 'careers', '{\"en\":\"<div class=\\\"row\\\"><div class=\\\"col-sm-12 ui-resizable\\\" data-type=\\\"container-content\\\"><div data-type=\\\"component-text\\\" data-aoraeditor-title=\\\"Text block\\\" data-aoraeditor-categories=\\\"Text\\\">\\n    <div class=\'row\'>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n            <div class=\'breadcrumb_area bradcam_bg_1 position-relative\'>\\n                <div class=\'breadcrumb_img w-100 h-100 position-absolute bottom-0 left-0\'>\\n                    <img class=\'w-100 h-100 img-cover\' src=\'http:\\/\\/localhost:4003\\/public\\/frontend\\/infixlmstheme\\/img\\/banner\\/bradcam_bg_1.jpg\' alt=\'\'>\\n                <\\/div>\\n                <div class=\'container\'>\\n                    <div class=\'row\'>\\n                        <div class=\'col-lg-9 offset-lg-1\'>\\n                            <div class=\'breadcam_wrap\'>\\n                                <span>Careers<\\/span>\\n                                <h3>careers<\\/h3>\\n                            <\\/div>\\n                        <\\/div>\\n                    <\\/div>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div class=\'col-sm-12 ui-resizable\' data-type=\'container-content\'>\\n        <div class=\'courses_area\'><div class=\'container\'><div class=\'row justify-content-center\'><div class=\'col-lg-12\'>\\n\\n            Go Beyond Traditional Careers and Build Your Dreams with Us\\n\\nAt LMS, we believe in working hard, failing fast and learning every second. We are constantly exploring ways of making our customers life simple and empowered.\\n\\nWe are a family of youthful and diverse risk-takers and challengers who are solving global problems through transformation and disruption.\\n\\nWe are what our teacher and students are- the number one in the industry; and the greatest way we reward them is through the opportunity to Go Beyond in developing a nation through education\\n\\n            <\\/div><\\/div><\\/div><\\/div>\\n        <\\/div>\\n    <\\/div><\\/div><\\/div><\\/div>\"}', 'careers', 1, 0, NULL, '2024-09-18 00:43:24', NULL, 1, 0),
