INSERT INTO `home_page_faqs` (`id`, `question`, `answer`, `status`, `order`, `created_at`, `updated_at`, `lms_id`) VALUES
(1, 'What is an LMS?', 'An LMS, or Learning Management System, is a software application designed to administer, track, and manage educational content and resources. It is commonly used in educational institutions and organizations for online learning and training.', 1, 9999999, NULL, NULL, 1),
(2, 'How does an LMS work?', 'An LMS works by providing a centralized platform for creating, delivering, and managing learning content. It typically includes features for course creation, user management, assessment tools, and reporting.', 1, 9999999, NULL, NULL, 1),
(3, 'What are the key features of an LMS?', 'Key features of an LMS include course creation and management, user enrollment and tracking, assessment and grading tools, collaboration features, reporting and analytics, and integration capabilities with other systems.', 1, 9999999, NULL, NULL, 1),
(4, 'Who can benefit from using an LMS?', 'LMSs are beneficial for educational institutions, corporate training programs, and any organization that wants to deliver and manage training and learning materials efficiently.', 1, 9999999, NULL, NULL, 1),
(5, 'What types of content can be delivered through an LMS?', 'LMSs support a variety of content types, including text-based materials, videos, interactive quizzes, assignments, and more. They can accommodate a range of learning styles and formats.', 1, 9999999, NULL, NULL, 1);
