INSERT INTO `modules` (`id`, `name`, `status`, `order`, `created_at`, `updated_at`, `details`, `lms_id`) VALUES
(1, 'AmazonS3', 1, 0, '2024-09-18 00:43:13', '2024-09-18 00:43:19', 'Amazon S3 is a service offered by Amazon Web Services that provides object storage through a web service interface. Amazon S3 Module Allow the to user add a lesson in Amazon S3 storage. After installing & active module, the user can find the Amazon S3 option as a host in add/edit lesson.', 1),
(2, 'BBB', 1, 1, '2024-09-18 00:43:13', '2024-09-18 00:43:19', 'BigBlueButton (BBB) is a free software web conferencing system for Linux servers designed for online learning. Like Zoom, Users can create classes and take classes. After installing & active the BBB module, the user can find BBB as a host in Virtual Class.  Users can set their own BBB server configuration.', 1),
(3, 'Sslcommerz', 1, 2, '2024-09-18 00:43:13', '2024-09-18 00:43:15', 'SSLCOMMERZ is the first payment gateway in Bangladesh opening doors for local businesses and entrepreneurs to receive payments over the Internet via their online stores, websites or apps.', 1),
(4, 'Jitsi', 0, 3, '2024-09-18 00:43:14', '2024-09-18 00:43:19', 'Jitsi is a collection of free and open-source multiplatform voice, video conferencing and instant messaging applications for the web platform, Windows, Linux, macOS, iOS and Android. Like Zoom/BBB,  Users can create rooms and take classes. After installing & active the Jitsi module, the user can find Jitsi as a host in Virtual Class.  Users can set their own Jitsi server/free Jitsi server.', 1),
(5, 'Subscription', 0, 4, '2024-09-18 00:43:15', '2024-09-18 00:43:19', 'Subscription Module Allow to create & sell a subscription plan. Two types of subscription options in this module. one is \"ALL Courses\". Where  All course under subscription. Another subsection option is \"Selected Courses\".  Admin/Instructor can select courses under any subscription plan. ', 1),
(6, 'SCORM', 0, 5, '2024-09-18 00:43:15', '2024-09-18 00:43:19', 'The SCORM module is a course activity that allows you (the teacher) to upload any SCORM  to include in your course. . After installing & active module, the user can find the SCORM option as a host in add/edit lesson.', 1),
(7, 'Chat', 0, 6, '2024-09-18 00:43:16', '2024-09-18 00:43:19', 'Communication between Course Instructor, Admin, Student. Main feature is one to one chat, group chat, voice record, file send, pusher integration, block unblock, chat configuration.', 1),
(8, 'Tax', 0, 7, '2024-09-18 00:43:17', '2024-09-18 00:43:19', 'Add Tax functionality in InfixLMS System. Admin can set tax percentage. Admin can Add country based tax percentage. When students buy any Item, the Tax will be applied. Tax can enable/disable/change anytime.', 1),
(9, 'WhatsappSupport', 0, 8, '2024-09-18 00:43:17', '2024-09-18 00:43:19', 'WhatsApp Chat Support Module ready for InfixLS that will help you to option to Non-stop messaging with clients on your website. This is one of the best ways to connect and interact with your customers, you can offer support directly as well as build trust and increase customer loyalty', 1),
(10, 'BundleSubscription', 0, 9, '2024-09-18 00:43:17', '2024-09-18 00:43:19', 'BundleSubscription modules allow creating a bundle. In bundle can add multiple courses/quizzes/classes. Admin/Instructors can create bundles. Admin/Instructors can set days. If set 0, then the bundle will never expire. But set days, then after student enrollment bundle will expire after selected days and students can not access. ', 1),
(11, 'Assignment', 0, 10, '2024-09-18 00:43:18', '2024-09-18 00:43:19', 'The assignment module allows teachers to collect work from students, review it and provide feedback including grades. The work students submit is visible only to the teacher and not to the other students unless a group assignment is selected. Assignment settings.', 1),
(12, 'TeachOffline', 0, 11, '2024-09-18 00:43:18', '2024-09-18 00:43:19', 'TeachOffline module allows import offline students and enrolls course to students. If the admin/instructor want to teach offline & track records then this module is useful for this purpose.', 1),
(13, 'Bkash', 0, 12, '2024-09-18 00:43:18', '2024-09-18 00:43:19', 'Bkash is a bangladeshi payment gateway. This module allow to get payment via Bkash', 1),
(14, 'CourseOffer', 0, 13, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'CourseOffer module allows making an offer to students. Admin/instructors can create flat rates/percentage prices of selected courses. one dedicated page for the course offer. There all offered courses are listed. ', 1),
(15, 'Org', 0, 14, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Org (Organization) module allow creating an Organization. Admin can create a branch, position. Also can add material sources.', 1),
(16, 'Group', 0, 15, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Group module for Infix LMS', 1),
(17, 'Catalogue', 0, 16, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Catalogue module for Infix LMS', 1),
(18, 'Forum', 0, 17, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Forum Module For InfixLMS.', 1),
(19, 'OrgInstructorPolicy', 0, 18, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'OrgInstructorPolicy module allows creating multiple group policies. Admin can assign role permissions & branches to group policy. Also can Assign instructors in group policy.', 1),
(20, 'Homework', 0, 19, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Homework Module For InfixLMS. ', 1),
(21, 'Communicate', 0, 19, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'Communicate module for Infix LMS', 1),
(22, 'OrgSubscription', 0, 21, '2024-09-18 00:43:19', '2024-09-18 00:43:19', 'OrgSubscription module allows creating a plan. In this module, there is 2 type of plan. One is a class where the admin adds one course. And another is a learning path where the admin can add multiple courses/quizzes/classes. Also, can enrollment students & class/learning path. And showing enrollment history.', 1),
